      text-align: center;
      font-size: 1.2em;
      margin-top: 20px;
      min-height: 1.5em;
    }
  </style>
</head>
<body>

<h2 style="text-align: center;">Cardiac Lead Placement Exercise</h2>
<p style="text-align: center; font-size: 1.1em;">Your patient needs leads placed properly. Please drag the leads into the correct position. Select the check placement button for feedback. </p>

<div id="patient-container">
  <div id="dropWhite" class="drop-zone" data-lead="white"></div>
  <div id="dropBlack" class="drop-zone" data-lead="black"></div>
  <div id="dropRed" class="drop-zone" data-lead="red"></div>
</div>

<div id="lead-palette">
  <div id="circleWhite" class="draggable" data-lead="white"></div>
  <div id="circleBlack" class="draggable" data-lead="black"></div>
  <div id="circleRed" class="draggable" data-lead="red"></div>
</div>

<div style="text-align: center;">
  <button id="checkButton">Check Placement</button>
  <button id="resetButton">Reset</button>
</div>
<div id="result"></div>

<script>
$(function() {
  // Make leads draggable
  function makeDraggable() {
    $(".draggable").draggable({
      revert: function(dropped) {
        if (!dropped) {
          $(this).data("droppedZone", null);
          $(this).css({ top: 0, left: 0 });
          return true;
        }
        return false;
      }
    });
  }

  makeDraggable();

  // Drop logic
  $(".drop-zone").droppable({
    accept: ".draggable",
    drop: function(event, ui) {
      var $zone = $(this);
      ui.draggable.position({
        of: $zone,
        my: "center",
        at: "center"
      });
      ui.draggable.data("droppedZone", $zone.data("lead"));
    }
  });

  // Check placement
  $("#checkButton").click(function() {
    var allCorrect = true;
    var placed = 0;
    $(".draggable").each(function() {
      var leadColor = $(this).data("lead");
      var dropZone = $(this).data("droppedZone");
      if (dropZone) placed++;
      if (leadColor !== dropZone) {
        allCorrect = false;
      }
    });

    if (placed < 3) {
      $("#result").text("Place all three leads before checking.");
    } else if (allCorrect) {
      $("#result").text("✅ All leads are placed correctly!");
    } else {
      $("#result").text("❗ Remember, white on the right, smoke over fire.");
    }
  });

  // Reset function
  $("#resetButton").click(function() {
    $(".draggable").each(function() {
      $(this).css({ top: 0, left: 0 }).data("droppedZone", null);
    });
    $("#result").text("");
  });
});
</script>

</body>
</html>
